Tales of the Legion of Super-Heroes #322
Publisher:  DC Comics
Publication Date:  April 1985

Writers:  Paul Levitz and Mindy Newell
Pencilers:  Dan Jurgens
Inker:  Karl Kesel
Colorist:  Carl Gafford
Letterer:  Ben Oda
Cover:  Dan Jurgens, Karl Kesel, and Anthony Tollin

Dawnstar and Brainiac 5 are still stuck on an archaic planet. Dawnstar is soon revered by some of the planet's natives, presumably due to her look with the wings.

Thanks goes to Tarutaru and theProletariat for this release.

